import React from "react";
import {
  FrontPageButtonStyle,
  FrontPageStyle,
} from "../../styles/FrontPageStyle/FrontPage.style.ts";

import Text1 from "./Boxes/Text1.tsx";
import Text2 from "./Boxes/Text2.tsx";
import Text3 from "./Boxes/Text3.tsx";
import Button from "./Boxes/Button.tsx";

function FrontPage() {
  return (
    <FrontPageStyle>
      <Text1 />
      <Text2 />
      <text3 />
      <FrontPageButtonStyle>
        <Button />
      </FrontPageButtonStyle>
    </FrontPageStyle>
  );
}

export default FrontPage;
